import { InputText, Password } from "primereact";
import { ButtonPrimary } from "../../../shared/components/buttons/ButtonPrimary";
import { LoginFormHooks } from "./Form.component";
import "./styles.css";
export const FormHtml = () => {
  const { handleSubmit, useChangeInput } = LoginFormHooks();
  return (
    <div className="container-fluid">
      <div className="items">
        <h1>Login</h1>
      </div>
      <div className="items">
        <form onSubmit={handleSubmit}>
          <h5>Left Icon</h5>
          <span className="p-input-icon-left">
            <i className="pi pi-user" />
            <InputText
              name="username"
              onChange={useChangeInput}
              placeholder="Username"
            />
          </span>
          <h5>Show Password</h5>
          <Password name="password" onChange={useChangeInput} toggleMask />
          <div>
            <ButtonPrimary
              type="submit"
              icon="pi pi-check"
              iconsPos="left"
              label="Save"
            />
          </div>
        </form>
      </div>
    </div>
  );
};
